import "./section-style.css";

export default function Section() {
  return (
    <div className="hero-section">
      <div className="hero">
        <h1>
          <span class="heading-primary--main">Outdoors</span>
          <span class="heading-primary--sub">is where life happens</span>
        </h1>
      </div>
    </div>
  );
}
